import React from 'react';
import data from './data.json';
import './Header.css'
export const Header = () => {
    return (
       <div className="header">



         {data.pages.map((data, key) => {
          return (
            <div>
              {data.title }
            </div>
          );
        })}



       </div>
    )
}
export default Header;
